  return (
    <>
    <h1>Mercadito Libre</h1>
    <div className="App">
      <BarraNav/>
      <nav>
              <ul>
                  <Link to='/' element={<Home/>} class='li'>Home</Link>
                  <Link to='/registro' element={<Registro/>} class='li'>Registro</Link>
                  <Link to='/login' element={<Login/>} class='li'>Login</Link>    
              </ul>
      </nav>
      <img src={mercadoLibreImg} className='App-logo' alt='Cartel de MercadoLibre'/>
    </div>
    </>
  );
}

export default App;
